import React from "react";
import { useParams } from "react-router-dom";
import { useEffect,useState } from "react";
import axios from "axios";

const ViewProfile = () =>
{
    const {id : did} = useParams();
    const [profile,setProfile] = useState([]);

    useEffect(()=>{
        axios.get("/employee/loanrequests/document/"+did)
        .then(response=>{
            setProfile(response.data.emp);
        }).catch(error=>{
            console.log(error);
        });
    }, []);

    return(
        <div>
            <h3>Employee Profile:</h3>
                <p>UserName: </p>
                <p>FirstName: </p>
                <p>LastName: </p>
                <p>Gender: </p>
                <p>Date of Birth: </p>
                <p>Phone: </p>
                <p>Email: </p>
                <p>NID: </p>
        </div>
    );
}
export default ViewProfile;
